import mainLogoImage from '../images/main_logo.png'

const Bedankt = () => (
   <div>
       <div className="container-bedankt">
            <img src={mainLogoImage} alt="La Garchère" />
            <h1 className="heading-style-2">Bedankt voor u aanvraag bij La Garchère.</h1>
            <p>Zodra u een bevestigingsmail hebt ontvangen kan u verzekerd zijn van u reservatie.</p>
       </div>

       <style jsx>{`
       .container-bedankt {
            height: 80vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            background-color: red;
            text-align: center;
            padding: 10%;
        }
        .heading-style-2 {
            text-transform: none;
        }
        .container-bedankt img {
            width: 100%;
        }


      `}</style>
   </div>

);  

export default Bedankt;
